import React from "react";
import * as AiIcons from "react-icons/ai";


export const SidebarData = [
    {
        title: "Home",
        path: "/homepage",
        icon: <AiIcons.AiFillHome />,
    },

    {
        title: "About",
        path: "/about",
        icon: <AiIcons.AiOutlineInfoCircle />,
    },

];

